import styled from 'styled-components';

export const OuterContainer = styled.div`
  margin: 0;
  padding: 0;
  background: black;
  position: relative;
`

export const BlogSmallTitle = styled.h3`
  color: white;
  text-align: center;
  font-size: 20px;
  font-weight: 400;
  font-family: 'Dancing Script', cursive;
`

export const BlogBigTitle = styled.h1`  
  color: white;
  text-align: center;
  padding-top: 10px;
  z-index: 2;
  font-size: 80px;
  font-weight: 400;
  font-family: 'Dancing Script', cursive;
  position: absolute;
  top: 1%;
  left: 50%;
`

export const BlogCover = styled.img`
  background: black;
  margin-top: 0px;
  width: 100%;
  z-index: 0;
`

